import React from 'react';
import ProjectList from '../Components/ProjectList';

import taskManager from "../Image/task-manager-react.png";

import calculatorPng from "../Image/calculator.png";
import chatAppPng from "../Image/chat-app.png";
import chipboardLandingPng from "../Image/chipboard-landing.png";


import "../CSS/Projects.css";

function Projects() {
    return (
        <div className="Projects">

            <div>
                <div><img src={taskManager} alt="Task Manager" /></div>
                <div>
                    <h4>Task Manager</h4>
                </div>
            </div>

        </div>
    )
};
export default Projects;
